import React,{useContext} from 'react'
import { Properties } from './App'
import {Functionality} from './Main'
const ComB = () => {

    const states = useContext(Properties)
    
    const func = useContext(Functionality)
  return (
    <div>
        <h1>
           {states.count} 
        </h1>
        <button 
        className='btn_css'
        onClick={func.inc_fun}
        >Increase
        </button>
        <button 
         onClick={func.dec_fun}
        className='btn_css'>
            Decrease
            </button>
    </div>
  )
}

export default ComB
